import style from "./Monthly.module.css";
import Button from "../../../UI/Button";

function CalendarMonthly(props) {
  return (
    <div className={style.monthly}>
      <div>
        <h6>Junary</h6>
        <Button type="button">{`${"<"}`}</Button>
        <Button type="button">{`${">"}`}</Button>
      </div>
      <div>
        <div>Sun</div>
        <div>Mon</div>
        <div>Tue</div>
        <div>Wed</div>
        <div>Thu</div>
        <div>Fri</div>
        <div>Sat</div>
      </div>
      <div className={style["monthly__days"]}></div>
    </div>
  );
}
export default CalendarMonthly;
